import React from 'react'


function Meme() {
  return (
    <div className="Meme">
        <form>
            <input type="text" placeholder="Top text" id="toptext" name="toptext"></input>
            <input type="text" placeholder="Bottom text" id="toptext" name="toptext"></input>
            <input type="submit" value="Submit">Get a new meme image</input>
        </form> 
    </div>
  );
}

export default Meme;
